Mark your calenders ! Monday February 27th 8pm Cst 

Join the fellas and Clinical Sexologist and Relationship Coach  @tiffyneerenee for a intimate conversation that will help us understand, empathize and give us tools to help guide us to have better conversations with our men.

It's time to address the elephant in the room. We need to learn how to have conversations with our men that are honest and open, yet sensitive, loving and supportive.

Sometimes we have no idea what these guys are going through.  We often make assumptions or ignore their feelings.  Men have been raised to shield their hearts and keep them firmly guarded, which keeps them from communicating the way they want to by default.

